p:"The API key can be obtained by registering the corresponding LLM supplier.",showMoreModels:"Show more models",baseUrl:"Base-Url",baseUrlTip:"If your API key is from OpenAI, just ignore it. Any other intermediate providers will give this base url with the API key.",modify:"Modify",systemModelSettings:"System Model Settings",chatModel:"Chat model",chatModelTip:"The default chat model for each newly created knowledge base.",embeddingModel:"Embedding model",embeddingModelTip:"The default embedding model for each newly created knowledge base. If you cannot find an embedding model from the dropdown, check if you are using RAGFlow slim edition (which does not include embedding models) or check https://ragflow.io/docs/dev/supported_models to see if your model provider supports this model.",img2txtModel:"Img2txt model",img2txtModelTip:"The default img2txt model for each newly created knowledge base. It describes a picture or video. If you cannot find a model from the dropdown, check https://ragflow.io/docs/dev/supported_models to see if your model provider supports this model.",sequence2txtModel:"Speech2txt model",sequence2txtModelTip:"The default ASR model for each newly created knowledgebase. Use this model to translate voices to corresponding text.",rerankModel:"Rerank model",rerankModelTip:"The default rerank model for reranking chunks. If you cannot find a model from the dropdown, check https://ragflow.io/docs/dev/supported_models to see if your model provider supports this model.",ttsModel:"TTS Model",ttsModelTip:"The default text-to-speech model. If you cannot find a model from the dropdown, check https://ragflow.io/docs/dev/supported_models to see if your model provider supports this model.",workspace:"Workspace",upgrade:"Upgrade",addLlmTitle:"Add LLM",modelName:"Model name",modelID:"Model ID",modelUid:"Model UID",modelNameMessage:"Please input your model name!",modelType:"Model type",modelTypeMessage:"Please input your model type!",addLlmBaseUrl:"Base url",baseUr